$(document).keydown(function (e) {
  if (!(e.keyCode === 37 || e.keyCode === 39 || e.keyCode === 13 || e.keyCode === 32)) {
    return;
  }
  switch (e.keyCode) {
    case 13:
      $('.speeds .fa').removeClass('active');
      if (window.Pause) {
        window.Pause = false;
        if (window.Speed === 0) {
          $('.speeds .fa-forward').addClass('active');
        } else {
          $('.speeds .fa-play').addClass('active');
        }
      } else {
        if (window.Speed === 0) {
          window.Speed = 2;
          $('.speeds .fa-play').addClass('active');
        } else {
          window.Speed = 0;
          $('.speeds .fa-forward').addClass('active');
        }
      }
      break;
    case 32:
      $('.speeds .fa').removeClass('active');
      window.Pause = !window.Pause;
      if (window.Pause) {
        $('.speeds .fa-pause').addClass('active');
      } else {
        if (window.Speed === 0) {
          $('.speeds .fa-forward').addClass('active');
        } else {
          $('.speeds .fa-play').addClass('active');
        }
      }
      break;
    case 37:
      var i = columns.indexOf(nav);
      nav = columns[i - 1];
      if (i === 0) {
        nav = columns[2];
      }
      tabs[nav]();
      break;
    case 39:
      var i2 = columns.indexOf(nav);
      nav = columns[i2 + 1];
      if (i2 === 2) {
        nav = columns[0];
      }
      tabs[nav]();
      break;
  }
});

