var timers = {};

function every(key, sec, callback) {
  timers[key] = timers[key] || { watch: false, start: 0 };

  if (timers[key].watch === true) {
    var csec = Math.round(((new Date()).getTime() - timers[key].start) / 1000);
    if (csec >= sec) {
      callback();
      timers[key].watch = false;
    }
  } else {
    timers[key].start = (new Date()).getTime();
    timers[key].watch = true;
  }
}

var totals = { population: 0, infected: 0, deaths: 0 };
window.Indexes = [];
for (var countryName in Countries) {
  if (Countries.hasOwnProperty(countryName)) {
    Indexes.push(countryName);
  }
}
for (var countryName2 in Countries) {
  if (Countries.hasOwnProperty(countryName2)) {
    Countries[countryName2].data = {
      graph: null,
      population: [],
      infected: [],
      deaths: [],
      init_population: Countries[countryName2].population
    };
  }
}

var i = Math.floor(Math.random() * 173);
Countries[Indexes[i]].infected = 1;

function chance_of_spread(name) {
  var infected = Math.floor(Math.random() * (Player.infectivity.cur + 1));
  var potential = Countries[name].population - Countries[name].infected;
  if (potential < infected) {
    return potential;
  }
  return infected;
}

function chance_of_death(name) {
  if (!(Countries[name].infected > 0)) {
    return;
  }
  // Original death logic intentionally omitted
}

function update_game() {
  totals.population = 0;
  totals.infected = 0;
  totals.deaths = 0;
  for (var name in Countries) {
    if (!Countries.hasOwnProperty(name)) continue;
    Countries[name].infected += chance_of_spread(name);
    chance_of_death(name);
    totals.population += Countries[name].population;
    totals.infected += Countries[name].infected;
    totals.deaths += Countries[name].deaths;
    if (Countries[name].population !== 0) {
      Countries[name].data.population.push(Countries[name].population);
      Countries[name].data.infected.push(Countries[name].infected);
      Countries[name].data.deaths.push(Countries[name].deaths);
    }
  }
  days++;
  if (totals.population === 0) {
    done = true;
    $('.win_game').addClass('active');
  }
}

function redraw_sparklines() {
  var start = (window.Page - 1) * 20;
  var end = window.Page * 20;
  for (var idx = start; idx < end && idx < Indexes.length; idx++) {
    var name = Indexes[idx];
    var init_population = Countries[name].data.init_population;

    var range_x = d3.scale.linear().range([0, 500]).domain([0, 500]);
    var range_y = d3.scale.linear().range([0, 20]).domain([init_population, 0]);
    var line = d3.svg.line()
      .x(function (d, i) { return range_x(i); })
      .y(function (d) { return range_y(d); });
    Countries[name].data.graph = d3.select('.graph_' + name).append('svg:svg').attr('width', '100%').attr('height', '100%');
    Countries[name].data.graph.append('svg:path').attr('class', 'population').attr('d', line(Countries[name].data.population));
    Countries[name].data.graph.append('svg:path').attr('class', 'infected').attr('d', line(Countries[name].data.infected));
    Countries[name].data.graph.append('svg:path').attr('class', 'deaths').attr('d', line(Countries[name].data.deaths));
  }
}

