function draw_pills() {
  $('.stat.lethality .pill').width((Player.lethality.cur / Player.lethality.max) * 100 + '%');
  $('.stat.infectivity .pill').width((Player.infectivity.cur / Player.infectivity.max) * 100 + '%');
  $('.stat.visibility .pill').width((Player.visibility.cur / Player.visibility.max) * 100 + '%');
}

function render_map() {
  var data = {};
  for (var name in Countries) {
    if (!Countries.hasOwnProperty(name)) continue;
    var per = Math.floor(((Countries[name].infected + Countries[name].deaths) / (Countries[name].population + Countries[name].deaths)) * 100);
    var fill = null;
    if (per <= 5) {
      fill = null;
    } else if (per <= 10) {
      fill = 10;
    } else if (per <= 20) {
      fill = 20;
    } else if (per <= 30) {
      fill = 30;
    } else if (per <= 40) {
      fill = 40;
    } else if (per <= 50) {
      fill = 50;
    } else if (per <= 60) {
      fill = 60;
    } else if (per <= 70) {
      fill = 70;
    } else if (per <= 80) {
      fill = 80;
    } else if (per <= 90) {
      fill = 90;
    } else if (per <= 100) {
      fill = 100;
    }
    data[name] = { fillKey: fill };
  }
  var map_options = {
    projection: 'mercator',
    geographyConfig: {
      borderColor: '#282828',
      popupOnHover: false,
      highlightOnHover: false
    },
    data: data,
    fills: {
      defaultFill: '#0f172a',
      10: '#e0f2fe',
      20: '#bfdbfe',
      30: '#93c5fd',
      40: '#60a5fa',
      50: '#3b82f6',
      60: '#2563eb',
      70: '#1d4ed8',
      80: '#1e40af',
      90: '#1e3a8a',
      100: '#020617'
    }
  };
  $('.map').html('').datamaps(map_options);
}

var data = {};
for (var countryIdx = 0; countryIdx < Datamap.prototype.worldTopo.objects.world.geometries.length; countryIdx++) {
  var country = Datamap.prototype.worldTopo.objects.world.geometries[countryIdx];
  data[country.id] = { name: country.properties.name };
}

function mainloop() {
  if (!done) {
    setTimeout(function () {
      mainloop();
      if (GameStart) {
        if (!Pause) {
          every('ev', Speed * 10, function () {
            window.Player.evolution_points++;
          });
          every('day', Speed, function () {
            update_game();
            draw_game();
            render_map();
            draw_pills();
          });
        }
      }
    }, (1000 / 60));
  }
}
mainloop();
